import React, { useState, useEffect } from "react";
import "./Popular.css";
import data from "../../epicure.json";
import { ICard, IPopular } from "../../interFaces/interFaces";
import Card from "../Card/Card";
import Restaurant from "../Restaurant/Restaurant";
import { log } from "console";
// import { IPopular } from "../../interFaces/interFaces";


const Popular: React.FC<any>= (props:any) => {
    console.log(props.kind)
    const kind: ICard[] = props.kind
    const popular=kind.filter((best) =>
    best.rating?.includes("5")
  );
  console.log(popular)
//     const popularDish: any = data.dishes.filter((dish) =>
//     dish.rating.includes("5")
//   );

  return (
    <>
      <div className="popular">
        <h1>popular restaurant in epicure:</h1>
        <div className="three-div">
        {popular.map((card:ICard)=>(
            <Card class={card.price ? "dish" : "rest"} img={card.img} name={card.name} icons={data.dishes[0].icons} about={data.dishes[0].about} price={data.dishes[0].price} img={data.restaurant[0].img} name={data.restaurant[0].name} chef={data.restaurant[0].chef} rating={data.restaurant[0].rating}/>
        ))}
          
        </div>
        <button>
          All restaurants <img src="/image/vector.svg" alt="" />
        </button>
      </div>
    </>
  );
};

export default Popular;

